import './App.css'
import {WebHeader} from './WebHeader'
import {Home} from './Home'
import {GetStarted} from './GetStarted'
import {Footer} from './Footer'
import {AboutMe} from './AboutMe'
import { Gallery } from './Gallery'

function App() {
  return (
    <>
    <WebHeader/>
    <Home/>
    <GetStarted/>
    <AboutMe/>
    <Gallery/>
    <Footer/>
    </>
  );
}

export default App;
